import React from "react";
import { useNavigate } from "react-router-dom";
import enjoyImg from "./assets/images/tattoos/enjoy.png"
import ItemDisplayer from "./ItemDisplayer";

export default function Tattoos() {
    const navigate = useNavigate();

    const tattoos = [
        {title: "enjoy being while becoming", imgs: [enjoyImg]}
    ];

    const openSlider = (tattoos) => {
        navigate("/slider", {state: {images: tattoo.imgs, title: tattoos.title}});
    }

    return (
        <div>
            <h2>Tattoos</h2>
            <div className="item-displayer">
                {tattoos.map((tattoos, index) => (
                    <ItemDisplayer
                        key={index}
                        title={tattoos.title}
                        img={tattoos.imgs[0]}
                    />
                ))}
            </div>
        </div>
    );
}
